sys_variable_value.value:
(function execute(inputs, outputs) {
    try {
        var tableGr = new global.GlideRecordUtil().getGR(inputs.table, inputs.sysid);
        outputs.is_match = GlideFilter.checkRecord(tableGr, inputs.enquery);

    } catch (e) {
        outputs.is_match = false;
    }
})(inputs, outputs);

